import React from "react";
import ReactDOM from "react-dom";
import logo from "./logo.svg";
import squareDisplay from "./squareDisplay";
import "./App.css";

function App() {
  return ReactDOM.render(<squareDisplay />, document.getElementById("root"));
}

export default App;
